import React from 'react'
import './App.css';
import {Button} from 'react-bootstrap'
import HomePage from './pages/home';

function App() {
  return (
    <div className="App">
    <HomePage />
    </div>
  );
  return (
    <div>
      { Button }
    </div>
  )
}

export default App;
